    }
    return (
        <div className='Login'>
            <div>
                <h1>Авторизация</h1>

                <form onClick={handleClick} className='LoginForm'>
                    <input type="text" />
                    <input type="text" />
                    <button type="success" onClick={this.handleLogin}>Войти</button>
                    <button type="primary" onClick={this.handleReg}>Регистрация</button>
                </form>
            </div>
        </div>
    )
}

export default Login;
